import {useEffect,useState} from "react";
import List from "../models/List.js";

function Results(){
    const [results,setResults] = useState();
    const [state,setState] = useState();
    const [date,setDate] = useState();
    const [cases,setCases] = useState();
    const [deaths,setDeaths] = useState();

    const [isLoading,setisLoading] = useState(true);

    const config = (res)=>{
        setResults(res.results);
        setState(res.state);
        setDate(res.date);
        setCases(res.cases);
        setDeaths(res.deaths);
        setList(res.list);
        setPage(res.page);
        setPages(res.pages);
        setResultsPerPage(res.resultsPerPage);
    }
    useEffect(() => {
        if(isLoading){
            async function fetchMyAPI() {
                let response = await fetch('http://localhost:8000/api/home');
                response = await response.json();
                console.log(response);
                config(response);
                setisLoading(false);
            }
            fetchMyAPI();
        }
    });

    return (
        <div className="Results">
            <ul class="list-group">
                <li class="list-group-item">Results:{results}</li>
                <li class="list-group-item">State:{state}</li>
                <li class="list-group-item"> Date:{date}</li>
                <li class="list-group-item"> Cases:{cases}</li>
                <li class="list-group-item">Deaths:{deaths}</li>
            </ul>    
        </div>
    );
}
export default Results
